import React from 'react';
import bg_dash from "../images/dashboard@2x.png";
import "./infos.css";
import {BrowserRouter as Router , Switch , Route,Link } from 'react-router-dom';
import Details from '../components/Tabs/Details/Details';
import Absence from '../components/Tabs/Absence/Absence';
import Finance from '../components/Tabs/Finance/Finance';
import Grades from '../components/Tabs/Grades/Grades';
import Exams from '../components/Tabs/Exams/Exams';
import Homework from '../components/Tabs/Homework/Homework';
import Attitude from '../components/Tabs/Attitude/Attitude';

export default function Test() {
    const Std =[
        {
            id:1,
            name:"Carole Chimako",
            class:"class",
            image:bg_dash
        },
        {
            id:2,
            name:"Chloé Modibo",
            class:"class",
            image:bg_dash
        },
        {
            id:3,
            name:"Diego Morata",
            class:"class",
            image:bg_dash
        },
        {
            id:4,
            name:"Grigoriy Kozhukhov",
            class:"class",
            image:bg_dash
        },
        {
            id:5,
            name:"Laura Sofía Ureña",
            class:"class",
            image:bg_dash
        },
        {
            id:6,
            name:"María Paula Morterero",
            class:"class",
            image:bg_dash
        },
        {
            id:7,
            name:"Núria Moura",
            class:"class",
            image:bg_dash
        },
        {
            id:8,
            name:"Sofía Alcocer",
            class:"class",
            image:bg_dash
        }
    ]
    return (
        <div className="students-container">
            {/* <div className="filter">
                <div className="search-box">
                    <div className="search-box-text">Select Class</div>
                    <div className="search-box-icon"></div>
                </div>
            </div> */}
            {Std.map(student =>{
                return(
                    <div className="student">
                        <div className="student-image" style={{backgroundImage:"url(" + student.image + ")"}}></div>
                        <div className="student-infos">
                            <div className="student-name">{student.name}</div>
                            <div className="student-class">{student.class}</div>
                        </div>
                    </div>
                )}
           )}
        </div>
    )
}
